import React from 'react'
import '../App.css';
import CARD from './CARD';
import {useState} from 'react'

function GETCARDS({ props }) {

    
    const [states, setStates] = useState(props ? props.state.suggestion : null)

    console.log(props)
    
    const filterItem = state => {
        setStates(state) 
     } 

    return (
        <div className="cards">
            <CARD  state= {states ? states : null } filterItem = {filterItem}/>
        </div>
    )


    
}
export default GETCARDS;
